import './App.css';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
import NavBar from './NavBar';

function App() {
  return (
    <>
       <BrowserRouter>
       <NavBar />
       <Routes>
          <Route exact path="/"/>
        </Routes>
        </BrowserRouter>
    </>

  );
}

export default App;
